import "./Expenses.css"
import ExpenseItem from './ExpenseItem'

const Expenses = (props) => {
  return (
    <div classNam>
           {props.value.map((index,id) => {
        return <ExpenseItem  title={index.title} amount={index.amount} date={index.date} key={id}></ExpenseItem>
      })}
    </div>
  )
}

export default Expenses
